import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import CinemaSysHomeRightItem from "../CinemaSysHomeRightItem";
import { GetListFilmByCinemaBrandId } from "../../redux/actions/CinemaListFilm";
import "./CinemaSysHomeRight.scss";
function CinemaSysHomeRight(props) {
  let CinemaBrandSelected = useSelector((state) => {
    return state.CinemaHome.CinemaBrandSelected;
  });
  console.log("CinemaBrandSelected: " + CinemaBrandSelected);
  let dispatch = useDispatch();
  useEffect(() => {
    dispatch(GetListFilmByCinemaBrandId(CinemaBrandSelected));
  }, [CinemaBrandSelected]);
  let listFilm = useSelector((state) => {
    return state.CinemaHome?.ListFilm;
  });
  console.log(listFilm);
  function showListFilm() {
    // console.log(listFilm[0]);
    return listFilm?.map((item, index) => {
      return <CinemaSysHomeRightItem item={item} key={index} />;
    });
  }
  return <div className="tab__content__filmShow">{showListFilm()}</div>;
}

export default CinemaSysHomeRight;
